import React from "react";

class AddContact extends React.Component {
	state = {
		nombre: "",
		email: "", 
	}
	render(){
		return(
		<div className="ui main">
		 <h2>Agrega Usuari</h2>
			<form className="ui form">
				 <div className="field">
					<label>Nombre</label>
						<input
							type="text"
							name="name"
							placeholder="Name" value={this.state.nombre} onChange={( e )=> this.setState({nombre: e.target.value})}/>
				</div>
				<div className="field">
					<label>Email</label>
					<input
						type="text"
						name="email"
						placeholder="Email"  value={this.state.email} onChange={( e )=> this.setState({email: e.target.value})} />
				</div>
				<button className="ui button blue">Agregar</button>
			</form>
		</div>
		  
		
		);
	}
	
}

export default AddContact;
